import styled from 'styled-components'

const StyledBlackKey = styled.div`
  height: 50%;
  width: 3rem;
  border-radius: 1rem;
  ${({pressed}) =>
    pressed ? `background-color: grey;` : `background-color:black;`}
`
export default StyledBlackKey
